import { Component } from "react";
import React from "react";

class About extends Component{
    render(){
        <div>
            <title>About Me</title>
            <p1>
                hellow is me.i am nutthaphong wongnan i am third year student.<br></br>
                at chaingmai university at computer sciance major.<br></br>
                i am 22 yearold.<br></br>
            </p1>
        </div>
    }
}

export default About
